import React from 'react';
import PropTypes from 'prop-types';
import './HomePage.css';


const HomePage = (props)  => {
    const sortNewest = (newses) => {
        newses.sort((a, b) => (new Date(b.createdAt).getTime() - new Date(a.createdAt).getTime()));
    }
    return (
        <div className='home_container'>
            {
                sortNewest(props.newses).map(news => (
                    <div key={news._id}>
                        {news.createdAt}
                    </div>
                ))
            }
        </div>
    );
}
HomePage.propTypes = {
    newses: PropTypes.array.isRequired
}

export default HomePage;
